\r\n A dictionary that contai:
包含应直接替换的参数的字典。关键是参数，值是替换的删除
这包括
1.参数映射到文字表达式
2.具有默认值的参数，并且没有参数。它应由默认值替换。
3.参数映射到标识符表达式
前：
void呼叫者（int i，int j，bool [] k）
{
    Callee（i，j，k）;
}
void callee（int a，int b，params bool [] c）
{
    dosomething（a，b，c）;
}
后：
void呼叫者（int i，int j，bool [] k）
{
    dosomething（i，j，k）;
}
void callee（int a，int b，params bool [] c）
{
    dosomething（a，b，c）;
}
4.一个特殊情况，参数仅在Callee方法主体中读取一次
前：
无效呼叫者（bool x）
{
    Callee（foo（），bar（））
}
void callee（int a，int b）
{
    dosomething（a，b）;
}
后：
无效呼叫者（bool x）
{
    dosomething（foo（），bar（））;
}
void callee（int a，int b）
{
    dosomething（a，b）;
}
在这种情况下，参数“ A”和“ B”应仅被参数表达式所取代。
注意：这可能会导致语义变化。它是设计。

